interface TabMenuProps {
  activeTab: 'fridge' | 'recipes' | 'diary'
  setActiveTab: React.Dispatch<
    React.SetStateAction<'fridge' | 'recipes' | 'diary'>
  >
}

// TabMenu 함수형 컴포넌트
function TabMenu({ activeTab, setActiveTab }: TabMenuProps) {
  return (
    <div className="flex tab-menu justify-between space-x-4 p-4 font-bold">
      <button
        onClick={() => setActiveTab('fridge')}
        className={`${
          activeTab === 'fridge' ? 'border-b-2 border-brown-300' : ''
        } h-16`}
      >
        마이냉장고
      </button>
      <button
        onClick={() => setActiveTab('recipes')}
        className={`${
          activeTab === 'recipes' ? 'border-b-2 border-black' : ''
        } pb-1`}
      >
        나의 레시피
      </button>
      <button
        onClick={() => setActiveTab('diary')}
        className={`${
          activeTab === 'diary' ? 'border-b-2 border-black' : ''
        } pb-1`}
      >
        요리일기
      </button>
    </div>
  )
}

export default TabMenu
